CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_CreateReview`(in member_id int , in in_toilet_id int , in content varchar(45) , in rating float)
BEGIN
declare avg_rating float;
if (select count(*) from review where `review`.`member_id`=member_id and `review`.`toilet_id`= in_toilet_id) < 1 then
insert into review values(default,member_id,in_toilet_id,content,rating);
select avg(`review`.`rating`) into avg_rating from review where `review`.`toilet_id` = in_toilet_id;
update toilet set `toilet`.`avg_rating` =  avg_rating where `toilet`.`toilet_id` = in_toilet_id;
else
select "already exist !!";
END if;
end ;;
