BEGIN
declare avg_rating float;
declare del_toilet_id int;
select toilet_id into del_toilet_id from review where `review`.`review_id` = review_id;
delete from review where `review`.`review_id` = review_id;
select avg(`review`.`rating`) into avg_rating from review where `review`.`toilet_id` = del_toilet_id;
