select JSON_ARRAYAGG(JSON_OBJECT("toilet_id",`toilet`.`toilet_id`,"name",`toilet`.`name`, "country_id", `toilet`.`country_id`, "city_id",`toilet`.`city_id`,"district_id",`toilet`.`district_id`,"longitude",`toilet`.`longitude`,"latitude",`toilet`.`latitude`,"avg_rating",`toilet`.`avg_rating`,"status",`toilet`.`status`,'address',`toilet`.`address`)) from toilet where district_id = district ; 
else
select JSON_ARRAYAGG(JSON_OBJECT("toilet_id",`toilet`.`toilet_id`,"name",`toilet`.`name`, "country_id", `toilet`.`country_id`, "city_id",`toilet`.`city_id`,"district_id",`toilet`.`district_id`,"longitude",`toilet`.`longitude`,"latitude",`toilet`.`latitude`,"avg_rating",`toilet`.`avg_rating`,"status",`toilet`.`status`,'address',`toilet`.`address`,'distance',distance(`toilet`.`latitude`,`toilet`.`longitude`,latitude,longitude))) from toilet where district_id = district order by distance(`toilet`.`latitude`,`toilet`.`longitude`,latitude,longitude) asc ; 
end if;
END ;;
